import React, {Fragment} from 'react';
import { Helmet } from 'react-helmet';

const Home = () => {
return ( 
    <Fragment>
        <Helmet><tittle>Quiz App - Home</tittle></Helmet>
        <div id="home">
            <section>
                <div>
                <span className="mdi mdi-play"></span>
                <h1>test</h1>
                </div>
            </section>
        </div>
    </Fragment>

);
}

export default Home;
